oxy_webhelp_navlinks = {"mail_troubleshooting-d4800e2380":{"topics":[{"title":"How do I cancel an email sent by mistake?","shortdesc":"<p class=\"shortdesc\">You can retract a message that you have already sent, if it is saved in the Sent view. This feature is useful if you sent a message in error, or if you want to edit the content of a sent message and resend it.<\/p>","href":"mail_recall_t.html","attributes":{"data-id":"mail_recall_t"},"menu":{"hasChildren":false},"tocID":"mail_recall_t-d4800e2391","topics":[]},{"title":"How do I remove a wrong address from the type-ahead list?","shortdesc":"<p class=\"shortdesc\">When you address an email, if an incorrect address appears in the type-ahead list, you can hide it. In the type-ahead list or the Recent Contacts view, right-click the address and then select <span class=\"ph uicontrol\">Hide in Recent Contacts<\/span>.<\/p>","href":"mail_remove_recent_contact_t.html","attributes":{"data-id":"mail_remove_recent_contact_t"},"menu":{"hasChildren":false},"tocID":"mail_remove_recent_contact_t-d4800e2402","topics":[]},{"title":"Why are some options greyed-out or locked?","shortdesc":"<p class=\"shortdesc\">If there are greyed-out or locked preferences or options anywhere in Notes, then your administrator has disabled those options, and you cannot change them.<\/p>","href":"mail_locked_c.html","attributes":{"data-id":"mail_locked_c"},"menu":{"hasChildren":false},"tocID":"mail_locked_c-d4800e2416","topics":[]},{"title":"How do I check spelling in multiple languages?","shortdesc":"<p class=\"shortdesc\">To check the spelling in emails and documents that use more than one language, you can tag text to be checked by a different dictionary. To use this feature, you must have dictionaries for other languages installed. For more information, ask your administrator.<\/p>","href":"mail_spell_check_multi_t.html","attributes":{"data-id":"doc_spell_check_multilang_t"},"menu":{"hasChildren":false},"tocID":"doc_spell_check_multilang_t-d4800e2427","topics":[]}]}};